import "./ProductItem.css";

let ProductItem = function ({product}) {
    return (
        <product-item>
            <product-image>
                <img src={product.image}></img>
            </product-image>
            <product-title>
                <div>{product.title}</div>
            </product-title>
                <item-price>
                    <div>{product.price}</div>    
                </item-price>

                <item-rating><div>{product.rating.rate} <span>({product.rating.count})</span></div></item-rating>
        </product-item>
    )
};

export default ProductItem;
